import React from "react";
import "./styles/style.css";
import doc from "./images/doc.png";

const Home = () => {
  return (
    <div className="home">
      <img alt="" src={doc}></img>
      <div>Journal</div>
      <img alt="" src={doc}></img>
      <div>Images</div>
    </div>
  );
};

export default Home;
